function App() {
  const { feriados, error } = useFeriados();

  if (error) return <div>Error: {error}</div>;

  return (
    <div>
      <h1>Feriados desde el a√±o 2020</h1>
      <ul>
        {feriados.map((feriado, index) => (
          <li key={index}>{`${feriado.fecha} - ${feriado.nombre}`}</li>
        ))}
      </ul>
    </div>
  );
}
